css:
/*
* This is sortof prepared for adjustable themes.
* Everything is based of a single color taken from the syntax theme.
*/
.key-binding-resolver {
  -webkit-flex: 0.25;
  overflow: auto;
}
.key-binding-resolver .keystroke {
  margin-right: 1em;
}
.key-binding-resolver table .used {
  color: #509e6a;
}
.key-binding-resolver table .unused {
  color: #4a4f4f;
}
.key-binding-resolver table .unmatched {
  color: rgba(74, 79, 79, 0.82);
}
.key-binding-resolver table .used .command::before,
.key-binding-resolver table .unused .command::before {
  font-family: 'Octicons Regular';
  font-weight: normal;
  font-style: normal;
  display: inline-block;
  line-height: 1;
  -webkit-font-smoothing: antialiased;
  text-decoration: none;
  font-size: 16px;
  width: 16px;
  height: 16px;
  content: "\f03a";
}
.key-binding-resolver table .unmatched .command::before {
  font-family: 'Octicons Regular';
  font-weight: normal;
  font-style: normal;
  display: inline-block;
  line-height: 1;
  -webkit-font-smoothing: antialiased;
  text-decoration: none;
  font-size: 16px;
  width: 16px;
  height: 16px;
  content: "\f081";
}
.key-binding-resolver table .command,
.key-binding-resolver table .selector,
.key-binding-resolver table .source {
  min-width: 10em;
}
.key-binding-resolver table .source {
  cursor: pointer;
}
